import '../Styles/navbar.css'

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="logo">
                <img  src="https://cdn.mos.cms.futurecdn.net/c6fFaJ2NrD7u2g8TP2u2iY.jpg" alt="" />
            </div>
            <div className="nav_links">
                <ul>
                    <li><a href=""></a>Home</li>
                    <li><a href=""></a>Favourites</li>
                    <li><a href=""></a>Add To Favourites</li>
                    <li><a href=""></a>log-Out</li>
                </ul>
            </div>
        </div>
    );
}

export default Navbar;
